import React from 'react'

export default function Navbar() {

    const NavStyle = {
        po
      }
    return (
        <>
            <nav class="navbar navbar-expand-lg bg-body-tertiary" data-bs-theme="dark" style={NavStyle}>
                <div class="container-fluid">
                    <a class="navbar-brand" href="#">Navbar</a>
                    <button type="button" class="btn btn-primary mx-2 my-2" style={NavStyle}>Login</button>
                    <button type="button" class="btn btn-secondary mx-2 my-2">SignUp</button>
                </div>
            </nav>
        </>
    )
    
    
}
